        onChange(e.target.value)
    }

    return (
        <div>
            <h2>Children1 component</h2>
            <input
            type={'text'}
            placeholder={'Enter something...'}
            onChange={firstChildrenHandler}
            />
        </div>
    );
};

export default Children1;
